erved"},"renderers":[{"id":"p554272"}]}},{"type":"object","name":"LegendItem","id":"p554286","attributes":{"label":{"type":"value","value":"LSTM Ensemble"},"renderers":[{"id":"p554283"},{"id":"p554293"},{"id":"p554302"},{"id":"p554311"},{"id":"p554320"},{"id":"p554329"},{"id":"p554338"},{"id":"p554347"},{"id":"p554356"},{"id":"p554365"}]}},{"type":"object","name":"LegendItem","id":"p554377","attributes":{"label":{"type":"value","value":"POR Observed"},"renderers":[{"id":"p554374"}]}},{"type":"object","name":"LegendItem","id":"p554387","attributes":{"label":{"type":"value","value":"timeEnsemble"},"renderers":[{"id":"p554384"}]}},{"type":"object","name":"LegendItem","id":"p554397","attributes":{"label":{"type":"value","value":"distEnsemble"},"renderers":[{"id":"p554394"}]}},{"type":"object","name":"LegendItem","id":"p554407","attributes":{"label":{"type":"value","value":"LN_MLE"},"renderers":[{"id":"p554404"}]}},{"type":"object","name":"LegendItem","id":"p554417","attributes":{"label":{"type":"value","value":"LN_PredictedLog"},"renderers":[{"id":"p554414"}]}},{"type":"object","name":"LegendItem","id":"p554427","attributes":{"label":{"type":"value","value":"LN_PredictedMOM"},"renderers":[{"id":"p554424"}]}},{"type":"object","name":"LegendItem","id":"p554437","attributes":{"label":{"type":"value","value":"KNN_2_NN"},"renderers":[{"id":"p554434"}]}},{"type":"object","name":"LegendItem","id":"p554447","attributes":{"label":{"type":"value","value":"KNN_4_NN"},"renderers":[{"id":"p554444"}]}},{"type":"object","name":"LegendItem","id":"p554457","attributes":{"label":{"type":"value","value":"KNN_8_NN"},"renderers":[{"id":"p554454"}]}}]}}],"below":[{"type":"object","name":"LogAxis","id":"p554243","attributes":{"ticker":{"type":"object","name":"LogTicker","id":"p554244","attributes":{"num_minor_ticks":10,"mantissas":[1,5]}},"formatter":{"type":"object","name":"LogTickFormatter","id":"p554245"},"axis_label":"Unit Area Runoff (L/s/km2)","major_label_policy":{"type":"object","name lt;/strong&gt;: Relative bias in expected flow from estimated PMFs/FDCs, \\( \\frac{ \\mathbb{E}[Q_{\\text{sim}}] - \\mathbb{E}[Q_{\\text{obs}}] }{ \\mathbb{E}[Q_{\\text{obs}}] } \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;RE&lt;/strong&gt;: Relative error, computed as \\( \\frac{F_{\\text{sim}}(p) - F_{\\text{obs}}(p)}{F_{\\text{obs}}(p)} \\), where \\( F(p) \\) denotes the duration curve (FDC) for exceedance duration \\(p\\).&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;NSE&lt;/strong&gt;: Nash\u2013Sutcliffe Efficiency, defined as \\( 1 - \\frac{\\sum (Q_{\\text{sim}} - Q_{\\text{obs}})^2}{\\sum (Q_{\\text{obs}} - \\bar{Q}_{\\text{obs}})^2} \\). Values closer to 1 indicate better performance.&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KGE&lt;/strong&gt;: Kling\u2013Gupta Efficiency, combining correlation, variability, and bias:&lt;br&gt;\n\\( \\quad \\mathrm{KGE} = 1 -\\ \\sqrt{(r - 1)^2 + (\\alpha - 1)^2 + (\\beta - 1)^2} \\)&lt;br&gt;\n\\(\\quad\\)&lt;strong&gt;r&lt;/strong&gt;: Pearson correlation; &lt;strong&gt;\u03b1&lt;/strong&gt;: ratio of standard deviations \\( \\left( \\frac{\\sigma_{\\text{sim}}}{\\sigma_{\\text{obs}}} \\right) \\); &lt;strong&gt;\u03b2&lt;/strong&gt;: bias ratio \\( \\left( \\frac{\\mu_{\\text{sim}}}{\\mu_{\\text{obs}}} \\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;KLD&lt;/strong&gt;: Kullback\u2013Leibler divergence between observed and simulated distributions:&lt;br&gt;\n\\( \\quad D_{\\mathrm{KL}}(P \\parallel Q) = \\sum P(x) \\log \\left(\\frac{P(x)}{Q(x)}\\right) \\)&lt;br&gt;&lt;br&gt;\n&lt;strong&gt;EMD&lt;/strong&gt;: Sum of absolute differences between cumulative distributions: \\( \\mathrm{EMD}(P, Q) = \\sum_x \\left| \\mathrm{CDF}_P(x) - \\mathrm{CDF}_Q(x) \\right| \\)\n&lt;/p&gt;\n"}}]}}]}}]}}
